import React, { Component } from 'react';

import './App.css';



function App(props){
  return(
    <div className="App">
        <h1>Title</h1>
        <p>This is the blog post paragraph</p>
        <p>{props.comment.text}</p>
        <p>{props.comment.author.name}</p>
        <Comment />
      </div>
  )
}

function Comment(){
  return(
    <div className="Comment">
      <div className="UserInfo"></div>
      <div className="Comment-text">there is stuff here</div>
    </div>
  )
}
export default App;
